const createFromIconfontCN = (icon: unknown) => {
  const { path } = icon as { path: JSX.Element };
  // eslint-disable-next-line react/display-name
  return () => {
    return <>{path}</>;
  };
};

type IconProps = {
  viewBox: string;
  path: JSX.Element;
  displayName: string;
};

const createIcon = (props: IconProps) => {
  const { viewBox, path } = props;
  const icon = {
    viewBox,
    path,
    defaultProps: {
      fill: 'currentColor'
    }
  };
  return createFromIconfontCN(icon);
};
